    <script>
      data = data.sort((a, b) => a.data.startTime - b.data.startTime);
      var container = document.querySelector(".box");
      const createEl = () => {
        const div = document.createElement("div");
        div.className = "item";
        return div;
      };
      var baseTime = 0;
      let aa = 0;
      data.forEach((item, idx) => {
        let width = 0;
        let ml = 0;
        const el = createEl();
        width = (item.data.responseEnd - item.data.fetchStart) / 2 + "px";
        // ml = (item.start - baseTime) / 10 + "px";
        ml = item.data.startTime / 10 + "px";
        switch (item.type) {
          case "resource":
            // el.innerHTML = `${item.data.resource};${
            //     item.data.responseEnd - item.data.fetchStart
            //   }ms`;
            el.innerHTML = `${item.data.resource};${(
              item.data.responseEnd - item.data.fetchStart
            ).toFixed(2)}ms`;
            break;
          case "net":
            // el.innerHTML = `${item.data.domain}${item.data.serverPath};${
            //     item.data.responseEnd - item.data.fetchStart
            //   }ms`;
            el.innerHTML = `${item.data.domain}${item.data.serverPath};${(
              item.data.responseEnd - item.data.fetchStart
            ).toFixed(2)}ms`;
            break;
          case "page":
            width = item.data.loadEventEnd / 2 + "px";
            ml = item.data.startTime / 10 + "px";
            el.innerHTML = `${item.data.domain}${item.data.serverPath};${(
              item.data.responseEnd - item.data.fetchStart
            ).toFixed(2)}ms`;
            break;
          default:
            return;
        }
        const style = `width: ${width}; margin-left: ${ml}`;
        el.style = style;
        aa++;
        container.appendChild(el);
      });

      data
        .sort((a, b) => a.data.startTime - b.data.startTime)
        .some((item, i) => {
          if (item.type === "net") {
            const info = data[i - 1];
            console.log(
              info.data.startTime +
                info.data.responseEnd -
                info.data.fetchStart,
              data[i].data.startTime
            );
            return true;
          }
          return false;
        });
    </script>
